import React, { Component } from "react";

export default class LItem extends Component {
  render() {
    return (
      <div>
        <label>
          <input type="checkbox" />
          <span></span>
        </label>

        <div class="todo-content">
          <input type="text" />
        </div>

        <div class="actions">
          <button class="delete">Delete</button>
        </div>
      </div>
    );
  }
}
